class StringUtil{static camelize(e){let r=e.replace(/[^a-zA-Z0-9 ]/g," ").toLowerCase();return r.split(" ").map((e,r)=>0===r?e:e.charAt(0).toUpperCase()+e.slice(1)).join("")}static upperCamel(e){return StringUtil.ucfirst(StringUtil.camelize(e))}static ucfirst(e){return e?e.charAt(0).toUpperCase()+e.slice(1):e}static snakeize(e){return e.replace(/[_\-]+/g," ").replace(/([a-z])([A-Z])/g,"$1 $2").replace(/[^a-zA-Z0-9 ]+/g,"").toLowerCase().replace(/\b\w/g,e=>e.toUpperCase()).replace(/\s+/g,"_").toLowerCase().replace(/^_+|_+$/g,"").replace(/__+/g,"_")}}